  assert scratch.startsWith(SI_NUM_DIAG);
  int numDiag = Integer.parseInt(readString(SI_NUM_DIAG.length, scratch));
  Map<String,String> diagnostics = new HashMap<String,String>();

  for (int i = 0; i < numDiag; i++) {
